<!-- <a class="home" href="/">Trading</a> -->
<a class="home" href="/"><h1>Trading View</h1> </a>
<div class="input_form">
  <label clas="label_box" for="url1">URL 1 <br /></label>
  <input
    class="input1"
    type="text"
    id="url1"
    [(ngModel)]="url1"
    required
    placeholder="Enter URL"
  /><br />

  <button class="clear_button" (click)="clearInput('url1')">
    <i class="bi bi-x-circle"></i>
  </button>

  <label for="url2">URL 2<br /></label>
  <input
    class="input1"
    type="text"
    id="url2"
    [(ngModel)]="url2"
    required
    placeholder="Enter URL"
  /><br />

  <label for="url3">URL 3<br /></label>
  <input
    class="input1"
    type="text"
    id="url3"
    [(ngModel)]="url3"
    required
    placeholder="Enter URL"
  /><br />

  <label for="url4">URL 4<br /></label>
  <input
    class="input1"
    type="text"
    id="url4"
    [(ngModel)]="url4"
    required
    placeholder="Enter URL"
  /><br />
  <!-- </form> -->
</div>
<div class="button_box">
  <button class="button" type="submit" (click)="openIframes()">Submit</button>
</div>

<ng-container *ngIf="loading"> Loading... </ng-container>

<!-- <ng-template #iframeTemplate> -->
<ng-template [ngIf]="url1 || url2 || url3 || url4">
  <app-home-page
    [url1]="url1"
    [url2]="url2"
    [url3]="url3"
    [url4]="url4"
    *ngIf="submitClicked"
  ></app-home-page>
</ng-template>

<div #iframeContainer class="iframe-container">
  <iframe #iframe *ngIf="selectedUrl" [src]="selectedUrl"></iframe>
</div>

